import React from "react";
import { Container, Menu } from "semantic-ui-react";

const NavBarComponent = navContent => (
	<Menu fluid stackable pointing secondary borderless attached="top">
		<Container fluid>
			<Menu.Item { ...navContent } position="left">
				{navContent.logo}
			</Menu.Item>
			{ navContent.denStoriesMenuItem}
			{ navContent.galleryMenuItem }
			<Menu.Item as={ navContent.gitHubNavItem.as } href={ navContent.gitHubNavItem.href } position="right">
				{navContent.gitHubNavItem.icon}
			</Menu.Item>
			<Menu.Item as={navContent.linkedinNavItem.as} href={navContent.linkedinNavItem.href} >
				{navContent.linkedinNavItem.icon}
			</Menu.Item>
		</Container>
	</Menu>
);

export default NavBarComponent;
